          <TextField id="standard-basic" label="Rate Per Gram" variant="standard"  onChange={(e)=> calcmultiply(e.target.value)} placeholder="Rate per gram" className='Rateper '/>

         </div>

         <div className="formInputs">
         <TextField id="standard-basic" label="Weight" variant="standard"  onChange={(e)=> calcmultiply(e.target.value)} placeholder="weight"/>
